        <form>

            <div class = "spform">

            <label for = "name">Source Name:</label>
            <input type = "text"  id = "name" value={name} onChange = {(e) => setName(e.target.value)} />

            </div> 

            <div class = "spform"> 

            <label for = "name">Source Email:</label>
            <input type = "text"  id = "email" value={name} onChange = {(e) => setEmail(e.target.value)} />


            </div>

            <button class="press">Submit</button>

        </form>
    )
}

